import React, { useState, useMemo } from "react";
import styles from "./Overview.module.css";
import {
  LineChart, Line, XAxis, YAxis, Tooltip, ResponsiveContainer,
  PieChart, Pie, Cell
} from "recharts";

import { sampleTransactions } from "./data";

const COLORS = ["#60a5fa", "#7dd3fc", "#34d399", "#fbbf24", "#fb7185"];

// Фильтры по времени
const filterByTime = (transactions, range) => {
  const now = new Date();
  return transactions.filter(t => {
    const dt = new Date(t.date);
    const diff = now - dt;

    if (range === "day") return diff < 1000 * 60 * 60 * 24;
    if (range === "week") return diff < 1000 * 60 * 60 * 24 * 7;
    if (range === "month") return diff < 1000 * 60 * 60 * 24 * 30;

    return true;
  });
};

const Overview = () => {
  const [transactions, setTransactions] = useState(sampleTransactions);
  const [timeFilter, setTimeFilter] = useState("month");
  const [categoryFilter, setCategoryFilter] = useState("all");
  const [typeFilter, setTypeFilter] = useState("all");

  // --------------------------
  //   ФИЛЬТРАЦИЯ ТРАНЗАКЦИЙ
  // --------------------------
  const filteredList = useMemo(() => {
    let list = [...transactions];

    list = filterByTime(list, timeFilter);

    if (categoryFilter !== "all") {
      list = list.filter(t => t.category === categoryFilter);
    }

    if (typeFilter !== "all") {
      list = list.filter(t => t.type === typeFilter);
    }

    return list;
  }, [transactions, timeFilter, categoryFilter, typeFilter]);

  // --------------------------
  //  ДАННЫЕ ДЛЯ ЛИНЕЙНОГО ГРАФИКА
  // --------------------------
  const lineData = useMemo(() => {
    // накапливаем баланс с течением времени
    let balance = 5000;
    return transactions
      .sort((a, b) => new Date(a.date) - new Date(b.date))
      .map(t => {
        balance += t.type === "income" ? t.amount : -t.amount;
        return { date: t.date.slice(5), balance };
      });
  }, [transactions]);

  // --------------------------
  //  ДАННЫЕ ДЛЯ КРУГОВОГО ГРАФИКА
  // --------------------------
  const pieData = useMemo(() => {
    const sums = {};
    transactions
      .filter(t => t.type === "expense")
      .forEach(t => {
        if (!sums[t.category]) sums[t.category] = 0;
        sums[t.category] += t.amount;
      });

    return Object.entries(sums).map(([k, v]) => ({
      name: k,
      value: v
    }));
  }, [transactions]);

  const deleteItem = (id) => {
    setTransactions(prev => prev.filter(t => t.id !== id));
  };

  const downloadJSON = () => {
    const data = JSON.stringify(transactions, null, 2);
    const blob = new Blob([data], { type: "application/json" });
    const link = document.createElement("a");
    link.href = URL.createObjectURL(blob);
    link.download = "transactions.json";
    link.click();
  };

  return (
    <div className="page">
      <h1 className={styles.title}>Overview</h1>

      {/* Графики */}
      <div className={styles.grid}>
        
        {/* Линейный график */}
        <div className={styles.card}>
          <h3>Balance Over Time</h3>
          <ResponsiveContainer width="100%" height={260}>
            <LineChart data={lineData}>
              <XAxis dataKey="date" stroke="#9aa6b2" />
              <YAxis stroke="#9aa6b2" />
              <Tooltip />
              <Line type="monotone" dataKey="balance" stroke="#60a5fa" strokeWidth={2} />
            </LineChart>
          </ResponsiveContainer>
        </div>

        {/* Круговой график */}
        <div className={styles.card}>
          <h3>Expenses Breakdown</h3>
          <ResponsiveContainer width="100%" height={260}>
            <PieChart>
              <Pie
                data={pieData}
                dataKey="value"
                nameKey="name"
                outerRadius={110}
                fill="#60a5fa"
                label
              >
                {pieData.map((entry, index) => (
                  <Cell key={index} fill={COLORS[index % COLORS.length]} />
                ))}
              </Pie>
            </PieChart>
          </ResponsiveContainer>
        </div>

      </div>

      {/* Фильтры */}
      <div className={styles.filters}>
        <select value={timeFilter} onChange={(e) => setTimeFilter(e.target.value)}>
          <option value="day">Сегодня</option>
          <option value="week">Неделя</option>
          <option value="month">Месяц</option>
          <option value="all">Все</option>
        </select>

        <select value={typeFilter} onChange={(e) => setTypeFilter(e.target.value)}>
          <option value="all">Тип (все)</option>
          <option value="income">Доход</option>
          <option value="expense">Расход</option>
        </select>

        <select value={categoryFilter} onChange={(e) => setCategoryFilter(e.target.value)}>
          <option value="all">Категория (все)</option>
          <option value="Food">Еда</option>
          <option value="Transport">Транспорт</option>
          <option value="Clothes">Одежда</option>
          <option value="Bills">Счета</option>
        </select>

        <button className={styles.downloadBtn} onClick={downloadJSON}>
          Скачать JSON
        </button>
      </div>

      {/* Таблица операций */}
      <div className={styles.card}>
        <h3>Transactions</h3>
        <table className={styles.table}>
          <thead>
            <tr>
              <th>Date</th><th>Category</th><th>Type</th><th>Amount</th><th></th>
            </tr>
          </thead>
          <tbody>
            {filteredList.map(t => (
              <tr key={t.id}>
                <td>{t.date}</td>
                <td>{t.category}</td>
                <td className={t.type === "income" ? styles.income : styles.expense}>
                  {t.type}
                </td>
                <td>{t.type === "expense" ? "-" : "+"}{t.amount}$</td>
                <td>
                  <button className={styles.deleteBtn} onClick={() => deleteItem(t.id)}>
                    ✖
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

    </div>
  );
};

export default Overview;
